tables.table_schema:
CREATE TABLE qubit_states (
    qubit_id SERIAL PRIMARY KEY,
    qubit_name VARCHAR(50) NOT NULL,
    state VARCHAR(10) NOT NULL,
    probability FLOAT NOT NULL
);

CREATE TABLE qubit_states (
  qubit_id INT PRIMARY KEY,
  state VARCHAR(255) NOT NULL,
  amplitude DECIMAL(10, 5) NOT NULL
);

CREATE TABLE measurements (
  measurement_id INT PRIMARY KEY,
  qubit_id INT,
  measurement_result VARCHAR(10) NOT NULL,
  FOREIGN KEY (qubit_id) REFERENCES qubit_states(qubit_id)
);

CREATE TABLE qubits (
    qubit_id INT PRIMARY KEY,
    qubit_state VARCHAR(20),
    measurement_result VARCHAR(20)
);

CREATE TABLE experiments (
    experiment_id INT PRIMARY KEY,
    experiment_name VARCHAR(50),
    experiment_date DATE
);

CREATE TABLE qubit_states (
    qubit_id SERIAL PRIMARY KEY,
    state VARCHAR(50) NOT NULL,
    probability FLOAT NOT NULL
);

CREATE TABLE qubit_measurements (
    measurement_id SERIAL PRIMARY KEY,
    qubit_id INT NOT NULL REFERENCES qubit_states(qubit_id),
    measurement_value FLOAT NOT NULL,
    measured_at TIMESTAMP NOT NULL
);

CREATE TABLE quantum_experiment (
    experiment_id SERIAL PRIMARY KEY,
    experiment_name VARCHAR(100) NOT NULL,
    start_time TIMESTAMP NOT NULL,
    end_time TIMESTAMP NOT NULL
);

CREATE TABLE quantum_simulation (
    simulation_id SERIAL PRIMARY KEY,
    simulation_name VARCHAR(100) NOT NULL,
    simulation_description TEXT NOT NULL,
    simulation_time TIMESTAMP NOT NULL
);
